import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import {
  getQuizz,
  deleteQuizz,
} from "../../../actions/teacher_framework_actions/create_quizz";

export class GET extends Component {
  static propTypes = {
    quizzes: PropTypes.array.isRequired,
    getQuizz: PropTypes.func.isRequired,
    deleteQuizz: PropTypes.func.isRequired,
  };
  //component load then
  componentDidMount() {
    this.props.getQuizz();
  }
  render() {
    return (
      <Fragment>
        <h2>VIEW CREATED ASSIGNMENT</h2>
        <table className="table table-stripped">
          <thead>
            <tr>
              <th>ID</th>
              <th>Created Time</th>
              <th>Subject Name</th>
              <th>Questions</th>
              <th />
            </tr>
          </thead>
          <tbody>
            {this.props.quizzes.map((quizz) => (
              <tr key={quizz.id}>
                <td>{quizz.id}</td>
                <td>{quizz.created}</td>
                <td>{quizz.subject_name}</td>
                <td>
                  {quizz.question_set.map((question, key) => (
                    <div key={question.id}>{question.label}</div>
                  ))}
                </td>
                <td>
                  <button
                    onClick={this.props.deleteQuizz.bind(this, quizz.id)}
                    className="btn btn-danger btn-sm"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </Fragment>
    );
  }
}

//state of redux
const mapStateToProps = (state) => ({
  assignments: state.assignments.assignments,
});
export default connect(mapStateToProps, { getQuizz, deleteQuizz })(GET);
